      been explained in previous memo. 2)  all checks that would have exceeded FEC
      limits were not delivered and were reported as RETURNED on the post election
      report.  3) It appears that the cumlative total for Jim Horn (schedule A  is
      now correct.  4) Since so many checks from this report were not delivered and
      were listed as RETURNED on the post election report we are not addressing the
      issue of listing the district/state of each contribution as this could cause
      the post general report returns to not offset the original account reported.  If
      after these RETURNED checks are recorded there are still contributions that
      need state and district information we would appreciate instructions as to how
